DROP TABLE IF EXISTS `title`;
CREATE TABLE `title` (
  `id` int(11) NOT NULL,
  `name` varchar(200) NOT NULL COMMENT '',
  `desc` varchar(1000) default NULL,
  `exp` int(11) default NULL COMMENT '',
  `level` int(11) default NULL,
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

